INSERT INTO `v1_9ef4f7c620008b3da02c57219729918843b9b412532a9087c9eb8c7fe01d7b34` VALUES (1, 62, "2025/01/31 12:00:00", 3.414, 1, 190805, "カリン", "ミッションをクリアすると、\n報酬がもらえますよ！\n頑張ってください", 0.0, "2030/01/01 14:59:59", -416.5, 2, 1, 1000001);
INSERT INTO `v1_9ef4f7c620008b3da02c57219729918843b9b412532a9087c9eb8c7fe01d7b34` VALUES (1, 62, "2025/01/31 12:00:00", 3.099, 1, 190805, "カリン", "ミッションをクリアして、\n報酬をゲットしましょう！", 0.0, "2030/01/01 14:59:59", -416.5, 2, 2, 1000002);
INSERT INTO `v1_9ef4f7c620008b3da02c57219729918843b9b412532a9087c9eb8c7fe01d7b34` VALUES (1, 63, "2025/01/31 12:00:00", 2.801, 1, 190805, "カリン", "受け取ることができる\n報酬があるようです\n確認してみてください", 0.0, "2030/01/01 14:59:59", -416.5, 2, 3, 1000003);
INSERT INTO `v1_9ef4f7c620008b3da02c57219729918843b9b412532a9087c9eb8c7fe01d7b34` VALUES (1, 63, "2025/01/31 12:00:00", 0.0, 2, 190805, "カリン", "報酬がもらえますよ！\nチェックしてみてください", 0.0, "2030/01/01 14:59:59", -416.5, 2, 4, 1000004);
INSERT INTO `v1_9ef4f7c620008b3da02c57219729918843b9b412532a9087c9eb8c7fe01d7b34` VALUES (1, 64, "2025/01/31 12:00:00", 2.12, 2, 190805, "カリン", "ギルド管理協会です！\nイベント報酬券をお持ちでしたら、様々なアイテムと交換できますよ", 0.0, "2030/01/01 14:59:59", -363.0, 1, 5, 1000005);
INSERT INTO `v1_9ef4f7c620008b3da02c57219729918843b9b412532a9087c9eb8c7fe01d7b34` VALUES (1, 64, "2025/01/31 12:00:00", 1.68, 1, 190805, "カリン", "お疲れさまです！\nこちらでイベント報酬券とアイテムを交換することができますよ", 0.0, "2030/01/01 14:59:59", -363.0, 2, 6, 1000006);
INSERT INTO `v1_9ef4f7c620008b3da02c57219729918843b9b412532a9087c9eb8c7fe01d7b34` VALUES (1, 64, "2025/01/31 12:00:00", 2.33, 2, 190805, "カリン", "いつもありがとうございます！\n報酬交換ですか？\nでは、イベント報酬券とお引き換えいたしますね", 0.0, "2030/01/01 14:59:59", -363.0, 1, 7, 1000007);
INSERT INTO `v1_9ef4f7c620008b3da02c57219729918843b9b412532a9087c9eb8c7fe01d7b34` VALUES (10201, 61, "2025/01/31 12:00:00", 5.18, 3, 133701, "ラビリスタ", "今度の敵は、アタシにとっても\n放ってはおけない存在だ\n少年、アタシも全力で行くからさ\n一緒に守ろう、この世界を", -6.0, "2030/01/01 14:59:59", -285.0, 7, 101, 1020101);
INSERT INTO `v1_9ef4f7c620008b3da02c57219729918843b9b412532a9087c9eb8c7fe01d7b34` VALUES (10201, 61, "2025/01/31 12:00:00", 8.77, 1, 133901, "クリスティーナ", "退屈の吹き飛ぶような\n戦いの気配がするなぁ坊や\nさっさとワタシをそこへ連れてゆけ\n世界も守ってやるさ、ついでにな", -2.0, "2030/01/01 14:59:59", -285.0, 2, 201, 1020102);
INSERT INTO `v1_9ef4f7c620008b3da02c57219729918843b9b412532a9087c9eb8c7fe01d7b34` VALUES (10201, 61, "2025/01/31 12:00:00", 15.5, 6, 133801, "ネネカ", "おや、私の力が必要……と？\nグレゴールが手伝うそうですよ\n私は戦わないのか、という顔ですね\n……考えておきます", 0.0, "2030/01/01 14:59:59", -285.0, 1, 301, 1020103);
INSERT INTO `v1_9ef4f7c620008b3da02c57219729918843b9b412532a9087c9eb8c7fe01d7b34` VALUES (10202, 61, "2025/02/28 12:00:00", 9.061, 2, 134301, "ランファ", "わたしだけの歌…\n一緒に、探してくれる…？\nあなたがいれば…\nもっとがんばれるから…", 0.0, "2030/01/01 14:59:59", -285.0, 5, 101, 1020201);
INSERT INTO `v1_9ef4f7c620008b3da02c57219729918843b9b412532a9087c9eb8c7fe01d7b34` VALUES (10202, 61, "2025/02/28 12:00:00", 7.699, 1, 134401, "チカ", "同じ唱喚士として、仲間として\n私にできることをします\n…これも、あなたが\n背中を押してくれたおかげですよ", 0.0, "2030/01/01 14:59:59", -285.0, 2, 201, 1020202);
INSERT INTO `v1_9ef4f7c620008b3da02c57219729918843b9b412532a9087c9eb8c7fe01d7b34` VALUES (10203, 61, "2025/03/31 12:00:00", 8.595, 1, 134601, "アオイ", "世界の平和が私とクローチェさんに\nかかってるんですよね？\nぼっちには過大すぎる期待ですけど\nふ、二人でなら背負ってみせます！", 0.0, "2030/01/01 14:59:59", -285.0, 2, 101, 1020301);
INSERT INTO `v1_9ef4f7c620008b3da02c57219729918843b9b412532a9087c9eb8c7fe01d7b34` VALUES (10203, 61, "2025/03/31 12:00:00", 7.758, 1, 134501, "クローチェ", "新しく手に入れたこの翼で…\nナイトさんがどこにいたって\nわたし、駆けつけちゃいますよっ！\nクローチェ・エアリアル発進ですっ", 0.0, "2030/01/01 14:59:59", -285.0, 2, 201, 1020302);
INSERT INTO `v1_9ef4f7c620008b3da02c57219729918843b9b412532a9087c9eb8c7fe01d7b34` VALUES (10204, 61, "2025/04/30 12:00:00", 7.0, 2, 132302, "ルイズマリー", "今日はダーリンとの初デート♪\n二人でショッピングして、その後は\n…って私、指名手配されてる！？\nちょ、た…助けてダーリン～！！", 0.0, "2030/01/01 14:59:59", -285.0, 6, 101, 1020401);
INSERT INTO `v1_9ef4f7c620008b3da02c57219729918843b9b412532a9087c9eb8c7fe01d7b34` VALUES (10204, 61, "2025/04/30 12:00:00", 7.904, 1, 132402, "イロハ", "ルイちゃんのおばあちゃん優しくて\nいつもにこにこで、イロハ大好き♪\nでも一番好きなのは、角がすっごく\n大きくてかっこいいとこなんだ～♪", 0.0, "2030/01/01 14:59:59", -285.0, 2, 201, 1020402);
INSERT INTO `v1_9ef4f7c620008b3da02c57219729918843b9b412532a9087c9eb8c7fe01d7b34` VALUES (10204, 61, "2025/04/30 12:00:00", 8.487, 4, 132502, "ソノ", "ノゾミちゃんのおかげで売上が安定\nしてきたのに、臨時休業、痛すぎる\n…ま、ルイちゃんのために\n一肌脱ぐか。行くよイロハ～", 0.0, "2030/01/01 14:59:59", -285.0, 2, 301, 1020403);
INSERT INTO `v1_9ef4f7c620008b3da02c57219729918843b9b412532a9087c9eb8c7fe01d7b34` VALUES (10205, 61, "2025/05/31 12:00:00", 8.763, 1, 134901, "カノン", "ヲ～ッホッホ♪\nあたくし様と同じお空気を吸える\nお幸運を噛みしめなさいですわ～♪\nヲ～ッホッホッホ～♪", 0.0, "2030/01/01 14:59:59", -285.0, 2, 101, 1020502);
INSERT INTO `v1_9ef4f7c620008b3da02c57219729918843b9b412532a9087c9eb8c7fe01d7b34` VALUES (10205, 61, "2025/05/31 12:00:00", 6.417, 1, 134801, "ツムギ", "いきますよ騎士さん！\nカノンさんと力を合わせて…力を…\n…本当にあの人なんなんです？\nこれまでになく不安なんですけど！", 0.0, "2030/01/01 14:59:59", -285.0, 3, 201, 1020503);
INSERT INTO `v1_9ef4f7c620008b3da02c57219729918843b9b412532a9087c9eb8c7fe01d7b34` VALUES (10206, 61, "2025/06/30 12:00:00", 10.335, 3, 135001, "エリス", "『願いが叶う海岸』か…怪しい\nだというのに、阿賀斗紫布菜たちは\n呑気に戯れている…見ていられない\n騎士クンは、わたしが守ってみせる", 0.0, "2030/01/01 14:59:59", -285.0, 7, 101, 1020601);
INSERT INTO `v1_9ef4f7c620008b3da02c57219729918843b9b412532a9087c9eb8c7fe01d7b34` VALUES (10206, 61, "2025/06/30 12:00:00", 6.281, 2, 135101, "シェフィ", "せっかくの夏休みなんだし\nたまにはビーチでゆっくりしましょ\n…え、もしかしてこの夏もあんまり\n休めなかったりする感じなの？", 0.0, "2030/01/01 14:59:59", -285.0, 4, 201, 1020602);
INSERT INTO `v1_9ef4f7c620008b3da02c57219729918843b9b412532a9087c9eb8c7fe01d7b34` VALUES (10206, 61, "2025/06/30 12:00:00", 12.244, 1, 135201, "プレシア", "いっぱい。たべて\nおおきく。なると\nせーぎ。まもれる。はず\nお兄。いっしょに。スイカ。たべよ", 0.0, "2030/01/01 14:59:59", -285.0, 2, 301, 1020603);
